import {useGlobalContext} from "../context";

const Dashboard = () => {
    const {user} = useGlobalContext();

    return (
        <div className='info'>
            <h2>
                <span>Dashboard</span>
            </h2>
            <p>
                Hello {user.name}
            </p>
        </div>
    );
};

export default Dashboard;
